import { BrowserRouter, Route, Routes } from "react-router-dom";
import HomePage from "./pages/HomePage";
import PageNotFound from "./pages/PageNotFound";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<HomePage />} />
        <Route to="/privacy-policy" element={<PageNotFound />} />
        <Route to="/terms-of-services" element={<PageNotFound />} />
        <Route to="/contact-us" element={<PageNotFound />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
